css:
@-moz-document domain("www.youtube.com") {
#yt-masthead-container, #page-container {
    background-color: rgb(5,105,115) !important;
  }
  
  #logo-container {
    display: block !important;
  }

#appbar-guide-button-container {
 	left: 100px;
	bottom: 30px; 
}

#yt-masthead-container {
 	height: 55px; 
}

#masthead-appbar {
 	width: 1280px; 
}

.watch-stage-mode #player {
 	margin-top: 20px !important; 
}

* {
 	color: rgb(5,105,115) !important;
}

#watch-header, .yt-uix-button-subscribe-branded, #action-panel-details, #watch7-sidebar-contents, #feed, .yt-ui-ellipsis, #section-list, .filter-top, .search-pager, #masthead-appbar, .branded-page-box, .yt-uix-expander-ellipsis, #appbar-guide-menu, .guide-item, #browse-items-primary,#results  {
  background-color: rgb(25,25,25) !important;
  border: 0;
}

.yt-uix-button-subscribe-branded {
  	border: 1px solid black !important;
  }

#watch8-action-buttons {
 	border: 0; 
} 
  
.video-extras-sparkbar-likes {
     	background-color: rgb(5,105,115) !important; 
    }

.browse-items-load-more-button {
   	margin: auto !important; 
  }

#content {
 	margin-top: 20px; 
}

.search-pager {
  	border-top: 1px solid #ddd;
  }
  
  .ytp-play-progress, .ytp-volume-slider-foreground:before, .html5-progress-bar:focus, .html5-scrubber-button:active, .html5-scrubber-button:hover  {
   	background-color: rgb(5,105,115) !important;
  }

.yt-badge {
   	border-color: rgb(5,105,115) !important;
  }

.html5-scrubber-button {
  	background-color: #aeaeae;
  }

.epic-nav-item-heading, .yt-uix-button-epic-nav-item:hover  {
   	border-color: rgb(5,105,115) !important;
  	margin-bottom: 5px;
  }

#page-container {
 	margin-top: 1px; 
}
}
